	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 256px; min-height: 358px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 0px; top: 0px; width: 256px; min-height: 358px;\"><p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size: 9pt;\">​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt;\"><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(255, 255, 255);\">Aan de hand van theorie en casuïstiek leer je wat de rol is van de sociotherapeut binnen het foren</span><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(255, 255, 255);\">sische werkveld en hoe deze ingevuld dient te</span><span style=\"font-family: Arial, sans-serif;\">&nbsp;</span><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(255, 255, 255);\">worden.</span></span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><strong><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">Leerdoelen:</span></strong></p>\n\n<p style=\"margin: 0px; line-height: 1.15;\"><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(255, 255, 255);\">Weten wat de rol, taken en verantwoordeli</span><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(255, 255, 255);\">jkheden zijn van de sociotherapeut (waarde, team en andere disciplines, taakverantwoordelijkheden).</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">&nbsp;​​​​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span><strong><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">Type leerproduct</span></strong></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">Leertraject</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span>​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span>​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span></p></div></div>",
