	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 256px; min-height: 266px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 0px; top: 0px; width: 256px; min-height: 266px;\"><p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​​</span><span style=\"color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size: 9pt;\">Aan de hand van theorie en casuïstiek leer je wat&nbsp;agressie precies is en hoe hiermee dient te worden omgegaan.</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span></p>\n\n<p><strong><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(255, 255, 255);\">Leerdoelen:</span></strong></p>\n\n<ul style=\"padding-left: 18px; padding-inline-start: 18px; margin-left: 0px;\">\n	<li style=\"font-size: 9pt; list-style-type: disc; color: rgb(255, 255, 255); padding-left: 0px; padding-inline-start: 0px; margin: 0px;\"><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(255, 255, 255);\">Weten welke manieren er zijn om om te gaan met agressie (in gesprek met cliënt).</span></li>\n</ul>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">&nbsp;​​​​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span><strong><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">Type leerproduct</span></strong></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">Leertraject</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span></p>\n\n<p style=\"line-height: 1.15; margin-top: 0px; margin-bottom: 0px;\"><span><span style=\"font-size: 9pt; color: rgb(255, 255, 255); font-family: Arial, sans-serif;\">​</span>​</span></p></div></div>",
